import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav, Container, NavDropdown } from "react-bootstrap";

const NavMenu = () => {
  return (
    <Navbar expand="lg" variant="black" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="#home">eduExp logo</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>

            <Nav.Link href="#Raghad">Raghad Page</Nav.Link>
            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
  // return (
  //  
  //         <Nav.Link>
  //           <Link to="/"> Home </Link>
  //         </Nav.Link>
  //         <Nav.Link>
  //           <Link to="/Dat"> Dat Page </Link>
  //         </Nav.Link>

  //         <Nav.Link>
  //           <Link to="/Raghad"> Raghad Page </Link>
  //         </Nav.Link>

  //         <Nav.Link>
  //           <Link to="/Russ"> Russ Page </Link>
  //         </Nav.Link>
  //       </Nav>
  //     </Container>
  //   </Navbar>
  // );


export default NavMenu;
